import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './components/Home';
import Header from './components/Header';
import Footer from './components/Footer';
import './App.css';

// Temporary placeholder components
const AITools = () => <div className="page-container"><Header /><div className="container"><h1>AI Tools</h1><p>This page is under development.</p></div><Footer /></div>;
const AIAgents = () => <div className="page-container"><Header /><div className="container"><h1>AI Agents</h1><p>This page is under development.</p></div><Footer /></div>;
const Pricing = () => <div className="page-container"><Header /><div className="container"><h1>Pricing</h1><p>This page is under development.</p></div><Footer /></div>;
const Blog = () => <div className="page-container"><Header /><div className="container"><h1>Blog</h1><p>This page is under development.</p></div><Footer /></div>;
const SignIn = () => <div className="page-container"><Header /><div className="container"><h1>Sign In</h1><p>This page is under development.</p></div><Footer /></div>;
const GetStarted = () => <div className="page-container"><Header /><div className="container"><h1>Get Started</h1><p>This page is under development.</p></div><Footer /></div>;
const Dashboard = () => <div className="page-container"><Header /><div className="container"><h1>Dashboard</h1><p>This page is under development.</p></div><Footer /></div>;

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/ai-tools" element={<AITools />} />
          <Route path="/ai-agents" element={<AIAgents />} />
          <Route path="/pricing" element={<Pricing />} />
          <Route path="/blog" element={<Blog />} />
          <Route path="/signin" element={<SignIn />} />
          <Route path="/get-started" element={<GetStarted />} />
          <Route path="/dashboard" element={<Dashboard />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
